import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../style/Header.css';

const Header = ({ isSignedIn, handleSignIn, handleSignOut, searchTerm, setSearchTerm, genres, setGenre, developers, setDeveloper, publishers, setPublisher, ratingRange, setRatingRange }) => {
  const navigate = useNavigate();
  const [showFilters, setShowFilters] = useState(false); // State to control filter visibility

  const handleSignInClick = () => {
    navigate('/signin'); // Navigate to the Sign In page
  };

  const handleSignUpClick = () => {
    navigate('/signup'); // Navigate to the Sign Up page
  };

  const toggleFilters = () => {
    setShowFilters(!showFilters); // Toggle the filter visibility
  };

  return (
    <div className="header">
      <div className="search-container">
        <input
          type="text"
          placeholder="Search games..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          className="search-bar"
          aria-label="Search games"
        />
        <button className="btn-filter" onClick={toggleFilters} aria-label="Toggle filter options">
          <span role="img" aria-label="filter">üîç</span> {/* Replace with an actual icon if needed */}
        </button>
      </div>

      {showFilters && (
        <div className="filter-options">
          <label htmlFor="genre-select">Genre:</label>
          <select id="genre-select" onChange={(e) => setGenre(e.target.value)} className="filter" aria-label="Select genre">
            <option value="">Select Genre</option>
            {genres.map((genre) => (
              <option key={genre} value={genre}>{genre}</option>
            ))}
          </select>

          <label htmlFor="developer-select">Developer:</label>
          <select id="developer-select" onChange={(e) => setDeveloper(e.target.value)} className="filter" aria-label="Select developer">
            <option value="">Select Developer</option>
            {developers.map((developer) => (
              <option key={developer} value={developer}>{developer}</option>
            ))}
          </select>

          <label htmlFor="publisher-select">Publisher:</label>
          <select id="publisher-select" onChange={(e) => setPublisher(e.target.value)} className="filter" aria-label="Select publisher">
            <option value="">Select Publisher</option>
            {publishers.map((publisher) => (
              <option key={publisher} value={publisher}>{publisher}</option>
            ))}
          </select>

          <label htmlFor="min-rating">Min Rating:</label>
          <input
            type="number"
            id="min-rating"
            placeholder="Min Rating"
            value={ratingRange.min}
            onChange={(e) => setRatingRange({ ...ratingRange, min: e.target.value })}
            className="filter"
            aria-label="Minimum rating"
          />
          <label htmlFor="max-rating">Max Rating:</label>
          <input
            type="number"
            id="max-rating"
            placeholder="Max Rating"
            value={ratingRange.max}
            onChange={(e) => setRatingRange({ ...ratingRange, max: e.target.value })}
            className="filter"
            aria-label="Maximum rating"
          />
        </div>
      )}

      <div className="auth-buttons">
        {isSignedIn ? (
          <button className="btn-signout" onClick={handleSignOut}>Sign Out</button>
        ) : (
          <>
            <button className="btn-signin" onClick={handleSignInClick}>Sign In</button>
            <button className="btn-signup" onClick={handleSignUpClick}>Sign Up</button>
          </>
        )}
      </div>
    </div>
  );
};

export default Header;
